import { Children } from "react";
import {
    Routes,
    Route,
    Link
} from "react-router-dom";

import { ComidaR } from "./Menus/ComidaRapida";
import { Des } from "./Menus/Desayunos";
import { Ensaladas } from "./Menus/Ensalada";

export function Contenido(){
    return(
        <div>
            <h1>Hola mundo</h1>
                <Routes>
                    <Route path="/ComidaRapida" element={<ComidaR/>}> </Route>
                    <Route path="/Ensaladas" element={<Ensaladas/>}> </Route>
                    <Route path="/Desayunos" element={<Des/>}> </Route>
                </Routes>
        </div>
    );
}
